    }

    render() {
        return (
            <div id="bgAreaLogin">
                <div id="areaLogin" className="">
                    <div className="logoAreaLogin">

                    </div>
                    <form className="formLogin" method="post">
                        <input className="inputCampo" type="text" autocomplete="off" placeholder="Usuário" name="usuario" value="" />
                            <input className="inputCampo" type="password" autocomplete="off" placeholder="Senha" name="senha" value="" />

                                <input className="btnLogar" onclick="submit()" type="submit" name="logar" value="Login" />
                                    <a className="esqueciASenha" href="esqueci-a-senha.php">Esqueci minha senha</a>
                                </form>
                            </div>
                        </div>
        )
    }
}
